import Vue from 'vue';
import Component from 'vue-class-component';
import { Route } from 'vue-router';
interface Item {
  text: string;
  href: string;
  active?: boolean;
}
@Component
export default class MyBreadcrumb extends Vue {
  get items() {
    const items = this.$route.matched.filter(r => Boolean(r.meta.title)).map(r => ({
      text: this.$t(r.meta.title),
      to: r.path,
    }));
    items.unshift({ text: this.$t('User Center'), to: '/' });
    return items;
  }
}
